import React from "react";
import {Link} from "react-router-dom";
import { makeStyles } from '@material-ui/core/styles';
import Card from '@material-ui/core/Card';
import CardActionArea from '@material-ui/core/CardActionArea';
import CardActions from '@material-ui/core/CardActions';
import CardContent from '@material-ui/core/CardContent';
import CardMedia from '@material-ui/core/CardMedia';
import Button from '@material-ui/core/Button';
import Typography from '@material-ui/core/Typography';
import Img2 from '../img/service_2.jpg';


const useStyles = makeStyles({
  root: {
    color: "#383e56",
    maxWidth: 345,
    marginLeft: "auto",
    marginRight: "auto",
    marginTop: "2em"
  },
  media: {
    height: 300,
  },
  buttonStyle: {
    color: "#d4b5b0",
  },
  textStyle: {
    color: "rgba(56, 62, 86, 1)",
    '&:hover': {
      color: "#d4b5b0",
    },
  }
});

function CardComponent2() {

  const classes = useStyles();

  return (
    <Card className={classes.root}>
      <CardActionArea>
        <CardMedia
          className={classes.media}
          image={Img2}
          title="Contemplative Reptile"
        />
        <CardContent>
          <Typography gutterBottom variant="h5" component="h2">
            <Link to="/leistung1" className={classes.headerStyle}>
              Schwangerenvorsorge
            </Link>
          </Typography>
          <Typography variant="body2" color="textSecondary" component="p">
            Ich helfe Ihnen sich auf die Geburt vorzubereiten. Ich zeige Ihnen auch all die coolen Werkzeuge.
          </Typography>
        </CardContent>
      </CardActionArea>
      <CardActions>
        <Button size="small">
          <Link className={classes.textStyle} to="/leistung2">Mehr Infos</Link>
        </Button>
      </CardActions>
    </Card>
  );
}

export default CardComponent2;
